func randomize() {
	seed:=rand.NewSource(time.Now().UnixNano())
	random:=rand.New(seed)
	for i:=1;i<=W+598;i++ {
		for j:=1;j<=H+598;j++ {
			graph[i][j]=random.Intn(2)
		}
	}
	gen=0
}

func empty() {
	for i:=0;i<1400;i++ {
		for j:=0;j<1000;j++ {
			graph[i][j]=0
		}
	}
	gen=0
}

func numOfSurrounded(x int, y int) int {
	surrounded:=0
	for i:=x-1;i<=x+1;i++ {
		for j:=y-1;j<=y+1;j++ {
			if graph[i][j]==1 && !(i==x && j==y) {
				surrounded++
			}
		}
	}
	
	return surrounded
}

func nextGen() {
	var graph0 [1400][1000]int = [1400][1000]int{{0}}
	
	for i:=1;i<=W+598;i++ {
		for j:=1;j<=H+598;j++ {
			surrounded:=numOfSurrounded(i, j)
			if graph[i][j]==1 {
				if surrounded==2 || surrounded==3 {
					graph0[i][j]=1
				}
			} else if surrounded==3 {
				graph0[i][j]=1
			}
		}
	}
	
	for i:=1;i<W+598;i++ {
		for j:=1;j<H+598;j++ {
			graph[i][j]=graph0[i][j]
		}
	}
	
	gen++
}

func update(screen *ebiten.Image) error {
	ebitenutil.DebugPrint(screen, fmt.Sprintf("[LEFT BOTTOM] Add Cell(s)    [2] 200*100    [4] 400*200    [8] 800*400    [P/p] Pause    [S/s] Start    [E/e] Exit        GEN: %6d\n[R/r] Random State    [N/n] Empty State    [G/g] Glider Gun    [C/c] Centinal    [F/f] Spacefiller    [B/b] Breeder 1", gen))
	
	//key
	if ebiten.IsMouseButtonPressed(ebiten.MouseButtonLeft) {
		xc, yc := ebiten.CursorPosition()
		if xc>=0 && xc<800 && yc>=32 && yc<400+32 {
			graph[xc/(800/W)+200][(yc-32)/(400/H)+200]=1
		}
	} else if ebiten.IsKeyPressed(ebiten.Key2) {
		W=200
		H=100
		randomize()
	} else if ebiten.IsKeyPressed(ebiten.KeyKP2) {
		W=200
		H=100
		randomize()
	} else if ebiten.IsKeyPressed(ebiten.Key4) {
		W=400
		H=200
		randomize()
	} else if ebiten.IsKeyPressed(ebiten.KeyKP4) {
		W=400
		H=200
		randomize()
	} else if ebiten.IsKeyPressed(ebiten.Key8) {
		W=800
		H=400
		randomize()
	} else if ebiten.IsKeyPressed(ebiten.KeyKP8) {
		W=800
		H=400
		randomize()
	} else if ebiten.IsKeyPressed(ebiten.KeyP) {
		flagS=0
	} else if ebiten.IsKeyPressed(ebiten.KeyS) {
		flagS=1
	} else if ebiten.IsKeyPressed(ebiten.KeyE) {
		os.Exit(0)
	} else if ebiten.IsKeyPressed(ebiten.KeyR) {
		randomize()
	} else if ebiten.IsKeyPressed(ebiten.KeyN) {
		empty()
	} else if ebiten.IsKeyPressed(ebiten.KeyG) {
		empty()
		for i:=0;i<9;i++ {
			for j:=0;j<36;j++ {
				for k:=0;k<8;k++ {
					graph[j+10+200][i+k*50+10+200]=gliderGun[i][j]
				}
			}
		}
	} else if ebiten.IsKeyPressed(ebiten.KeyC) {
		empty()
		for i:=0;i<17;i++ {
			for j:=0;j<52;j++ {
				graph[j+W/2-52/2+200][i+H/2-17/2+200]=centinal[i][j]
			}
		}
	} else if ebiten.IsKeyPressed(ebiten.KeyF) {
		empty()
		for i:=0;i<43;i++ {
			for j:=0;j<29;j++ {
				graph[j+W/2-29/2+200][i+H/2-43/2+200]=spacefiller[i][j]
			}
		}
	} else if ebiten.IsKeyPressed(ebiten.KeyB) {
		empty()
		W=800
		H=400
		for i:=0;i<338;i++ {
			for j:=0;j<749;j++ {
				graph[j+10+200][i+10+200]=breeder1[i][j]
			}
		}
	}
	
	//draw
	px, _ := ebiten.NewImage(800/W, 400/H, ebiten.FilterNearest)
	px.Fill(color.White)
	opts:=&ebiten.DrawImageOptions{}
	for i:=200;i<W+200;i++ {
		for j:=200;j<H+200;j++ {
			if graph[i][j]==1 {
				opts.GeoM.Translate(float64((i-200)*800/W), float64((j-200)*400/H+32))
				screen.DrawImage(px, opts)
				opts.GeoM.Translate(float64(-(i-200)*800/W), float64(-(j-200)*400/H-32))
			}
		}
	}
	
	if flagS == 1 {
		nextGen()
	}
	
	return nil
}


func main() {
	randomize()
	ebiten.SetVsyncEnabled(true)
	ebiten.Run(update, 800, 400+32, 2, "Conway's Game of Life")
}